import React from 'react';

import { Menu } from 'antd';

class CustomHeader extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      currentMenu: "home"
    };
  }

  selectMenu = e => {
    console.log('click ', e);
    this.setState({
      currentMenu: e.key,
    });
  };

  render() {
    return (
      <Menu onClick={this.handleClick} selectedKeys={[this.state.currentMenu]} mode="horizontal">
        <Menu.Item key="home">
          Home
        </Menu.Item>
      </Menu>
    )
  }
}

export default CustomHeader;
